import './Footer.css'

class Footer extends Component {
  render() {
    return (
      <footer>
        <div className="footer-name">Atruity.</div>
        <div className="footer-menu">
          <ul>
            <li>Services</li>
            <li>Build Your Plan</li>
            <li>Access Your Plan</li>
            <li>Toolkit</li>
            <li>Tour</li>
          </ul>
          <ul>

          </ul>
        </div>
      </footer>
    );
  }
}

export default Footer;
